<!DOCTYPE html>
<html lang="en">
<head>
<meta charset="UTF-8">
<title>JavaScript engines</title>
<style>
body {
  font-family: /*'Roboto Condensed',*/ -apple-system, BlinkMacSystemFont, "Segoe UI", "Noto Sans", Helvetica, Arial, sans-serif;
  font-size: 14px;
  background-color: #ffffff;
}

table {
  width: 100%;
  border-collapse: collapse;
}

th, td {
  padding: 3px 5px 3px 5px;
  text-align: left;
  border: 1px solid #d1d9e0b3;
  vertical-align: center;
}
td {
  vertical-align: top;
}

th {
  background-color: #eaecf0;
  font-weight: 600;
  position: sticky;
  top: 0;
  z-index: 10;
  user-select: none;
}

thead th {
  border-bottom: none;
  box-shadow: inset 0 -1px 0 #ccc;
}

table tbody:nth-of-type(1) tr:nth-of-type(1) td {
  border-top: none !important;
}

th:hover {
  background-color: #ddd;
}

.sorted-column {
  background-color: #eeeeff;
}

.missing {
  background-color: #eee !important;
}

tbody tr:nth-child(even) .sorted-column {
  background-color: #eeeeff;
}

tbody tr:nth-child(even) {
  background-color: #f6f8fa;
}

tbody tr:hover {
  background-color: #fff3cd;
}

tbody tr:hover .sorted-column {
  background-color: #fff3cd;
}

th.sort-asc:not(.benchmark)::after, th.sort-asc div::after {
  content: '▲';
}

th.sort-desc:not(.benchmark)::after, th.sort-desc div::after {
  content: '▼';
}

.engine-cell {
  min-width: 120px;
}

.engine-name {
  font-weight: 600;
  color: #0066cc;
  text-decoration: none;
}

.engine-name:hover {
  text-decoration: underline;
}

.engine-version {
  font-size: 12px;
  color: #333;
  text-decoration: none;
}

.engine-version a:hover {
  text-decoration: underline;
}

.description-cell {
  min-width: 300px;
  white-space: normal;
  word-wrap: break-word;
}

.numeric {
  text-align: right;
}
td.numeric {
  color: #0066ff;
}

th.benchmark div {
  font-size: 8px;
  display: flex;
  margin: 0;
  padding: 0px;
  align-items: center;
}

th input[type="checkbox"] {
  margin: 0px;
  padding: 0px;
  transform: scale(0.66);
}

.excluded-column {
  background-color: #eee !important;
}

.controls {
  padding-bottom: 10px;
}
</style>
</head>
<body>
<div class="controls">
  <select id="controlPlatform" class="control">
    <option value="arm64" selected>arm64: Mac M4 4.5GHz - Linux VM</option>
    <option value="x64">x64: i9-10900K 3.7GHz - Linux</option>
  </select>
  <input id="controlJitless" type="checkbox" class="control" /><label for="controlJitless">Show JIT-less runs</label>
  <!-- | <input id="controlBaseline" type="checkbox" class="control" /><label for="controlBaseline">Show baseline JIT</label>-->
  <!-- | Score aggregation:
  <select id="controlAgg" class="control">
    <option value="median" selected>median</option>
    <option value="max">max</option>
    <option value="iqm">interquartile mean</option>
  </select>-->
</div>
<table>
  <thead id="jshead">
    <tr>
      <th data-col="engine" class="engine-cell">Engine</th>
      <th data-col="totalScore" class="numeric sort-desc sorted-column" title="Total score: geometric mean of selected benchmark scores. Higher is better.">Score</th>
      <th data-col="binarySize" class="numeric" title="Binary size">Binary</th>
      <th data-col="loc" class="numeric" title="Lines of code of core engine code, non-blank, non-comment">LoC</th>
      <th data-col="language" title="Main programming language">Lang</th>
      <th data-col="standard" title="ECMAScript standard (targeted/mostly compliant with)">Standard</th>
      <th data-col="jit">JIT</th>
      <th data-col="years">Years</th>
      <th data-col="org">Org</th>
      <th data-col="license">License</th>
      <th data-col="description" class="description-cell">Description</th>
      <th data-col="Richards" class="numeric benchmark"></th>
      <th data-col="DeltaBlue" class="numeric benchmark"></th>
      <th data-col="Crypto" class="numeric benchmark"></th>
      <th data-col="RayTrace" class="numeric benchmark"></th>
      <th data-col="EarleyBoyer" class="numeric benchmark"></th>
      <th data-col="RegExp" class="numeric benchmark"></th>
      <th data-col="Splay" class="numeric benchmark"></th>
      <th data-col="SplayLatency" class="numeric benchmark" title="SplayLatency: GC latency"></th>
      <th data-col="NavierStokes" class="numeric benchmark"></th>
      <th data-col="PdfJS" class="numeric benchmark"></th>
      <th data-col="Mandreel" class="numeric benchmark"></th>
      <th data-col="MandreelLatency" class="numeric benchmark" title="MandreelLatency: compilation latency"></th>
      <th data-col="Gameboy" class="numeric benchmark"></th>
      <th data-col="CodeLoad" class="numeric benchmark"></th>
      <th data-col="Box2D" class="numeric benchmark"></th>
      <th data-col="zlib" class="numeric benchmark"></th>
      <th data-col="Typescript" class="numeric benchmark"></th>
    </tr>
  </thead>
  <tbody id="jsbody"></tbody>
</table>

<script>
let selectedBenchmarks = new Set(Array.from(
  document.querySelectorAll('#jshead th.benchmark')).map(th => th.dataset.col));
let sortState = { col: 'totalScore', dir: 'desc' };
let processedData = null;

window.addEventListener('load', () => {
  renderTable();

  document.querySelectorAll('.control').forEach(el => {
    el.addEventListener('change', renderTable);
  });

  document.querySelectorAll('#jshead th').forEach(th => {
    th.addEventListener('click', (e) => {
      if (e.target.tagName.toUpperCase() === 'INPUT') return false;
      if (sortState.col === th.dataset.col) {
        sortState.dir = sortState.dir === 'desc' ? 'asc' : 'desc';
      } else {
        sortState.col = th.dataset.col;
        sortState.dir = th.classList.contains('numeric') ? 'desc' : 'asc';
      }
      renderTable();
    });
  });
});

function renderTable() {
  processedData = processRawData();

  document.querySelectorAll('#jshead th').forEach(th => {
    th.classList.remove('sort-asc','sort-desc','sorted-column');
  });
  const th = document.querySelector(`#jshead th[data-col="${sortState.col}"]`);
  th?.classList?.add(sortState.dir === 'asc' ? 'sort-asc' : 'sort-desc', 'sorted-column');

  const jshead = document.getElementById('jshead');
  jshead.querySelectorAll('.benchmark').forEach(th => {
    const col = th.dataset.col;
    th.innerHTML = `
      <div>
        <input type="checkbox" ${selectedBenchmarks.has(col) ? 'checked' : ''} title="Check to include in total score">
        ${col.replace("Latency", "L")}
      </div>`;
    th.classList.toggle('excluded-column', !selectedBenchmarks.has(col));
    th.querySelector('input').addEventListener('change', e => {
      e.target.checked ? selectedBenchmarks.add(col) : selectedBenchmarks.delete(col);
      renderTable();
    });
  });

  const tbody = document.getElementById('jsbody');
  tbody.innerHTML = '';
  const headers = Array.from(jshead.querySelectorAll('th'));
  processedData.forEach(row => {
    const tr = document.createElement('tr');
    headers.forEach(th => {
      tr.appendChild(renderCell(th, row));
    });
    tbody.appendChild(tr);
  });
}

function renderCell(th, row) {
  const col = th.dataset.col;
  const td = document.createElement('td');
  td.className = th.className;
  if (col === 'engine') {
    let ver_link = row.repo;
    if (row.revision && row.repo) {
      if (row.repo.match(/github.com/)) {
        ver_link = `${row.repo.replace('.git','')}/tree/${row.revision}`;
      } else if (row.repo.match(/codeberg.org/)) {
        ver_link = `${row.repo.replace('.git','')}/src/commit/${row.revision}`;
      } else if (row.repo === 'https://chromium.googlesource.com/v8/v8.git') {
        ver_link = `https://github.com/v8/v8/tree/${row.revision}`;
      }
    }
    td.innerHTML = `
      <div class="engine-cell">
        <a href="${row.url ?? row.repo ?? ''}" class="engine-name" target="_blank">${row.engine}</a>
        <div class="engine-version">
          <a class="engine-version" href="${ver_link}" target="_blank">${row.version ?? ''}</a>
        </div>
      </div>`;
  } else if (col === 'loc' && Number(row.loc)) {
    let size = Number(row.loc), i = 0, suf = ['', 'K', 'M'];
    while (size >= 1000 && i < suf.length - 1) { size /= 1000; i++; }
    td.innerHTML = size.toFixed(size < 20 ? 1 : 0) + suf[i];
    td.title = `${row.loc}`;
  } else if (col === 'binarySize' && row.binarySize) {
    let size = Number(row.binarySize), i = 0, suf = ['', 'K', 'M'];
    while (size >= 1024 && i < suf.length - 1) { size /= 1024; i++; }
    td.innerHTML = size.toFixed(size < 20 ? 1 : 0) + suf[i];
    td.title = `${row.binarySize} bytes`;
  } else if (col === 'license' && row.license) {
    td.innerHTML = row.license.replace(/(Apache|MPL)-[0-9.]*($|\+)/g, '$1').replace('-Clause', '');
    td.title = `${row.license}`
  } else if (col === 'standard' && row.standard) {
    td.innerHTML = row.standard.replace(/ /, '<br>');
  } else if (col === 'years' && row.years) {
    td.innerHTML = row.years.replace(/-/, '-<br>');
  } else if (col === 'jit') {
    td.innerHTML = row.jit ? 'Y' : '';
  } else if (col === 'description') {
    td.innerHTML = `${row.description ?? ''}<br>${row.tech ? 'Tech: ' + row.tech : ''}`;
    if (row.note) {
      td.innerHTML += `<br>${row.note}`;
    }
  } else if (th.classList.contains('benchmark')) {
    const agg = row[col];
    const val = agg?.value ?? '';
    if (val === '' || isNaN(Number(val))) {
      td.innerHTML = '';
      td.className += ' missing';
    } else {
      td.innerHTML = String(val|0);
      td.title = `N=${agg.N} max=${agg.max} median=${agg.median} mean=${agg.mean} iqm=${agg.iqm} sd=${agg.sd}`;
    }
    if (row[col]?.error) {
      td.title = row[col].error;
      td.style.cursor = 'help';
    }
  } else {
    td.innerHTML = row[col] ?? '';
  }
  return td;
}

function processRawData() {
  const platform = document.getElementById('controlPlatform')?.value ?? 'arm64';
  const showJitless = document.getElementById('controlJitless')?.checked;
  const aggFn = document.getElementById('controlAgg')?.value ?? 'median';

  const raw = kRawData[platform];
  const engines = new Set([...Object.keys(raw.metadata), ...Object.keys(raw.runs)]);
  const rows = [];

  for (const engine of engines) {
    if (engine.includes('jitless') && !showJitless) continue;

    let row = {};
    for (const col in raw.runs[engine] ?? {}) {
      const run = raw.runs[engine][col];
      if (col === 'note') {
        row[col] = run;
      } else if (typeof run === 'string') {
        row[col] = {'error': run, 'value': ''};
      } else if (Array.isArray(run?.scores) && run.scores.length > 0) {
        row[col] = aggregateScores(run.scores);
        row[col]['value'] = row[col][aggFn];
      }
    }

    let selectedScores = [...selectedBenchmarks].map(col => row[col]?.value).filter(Boolean);

    row = {
      'engine': engine,
      'totalScore': geometricMean(selectedScores)|0,
      // Merge most of missing metadata from parent, e.g. v8 into v8-jitless
      ...(dropEmptyKeys(raw.metadata[engine.replace(/-.*/, '')]) ?? {}),
      ...(dropEmptyKeys(raw.metadata[engine]) ?? {}),
      ...row,
    };

    row['jit'] = (
      row['tech']?.includes('JIT') &&
      !engine.includes('jitless') &&
      !(row['tech']?.includes('JIT (x') && platform === 'arm64')
    );

    rows.push(row);
  }

  return rows.sort(rowCmp);
}

function rowCmp(row1, row2) {
  let a = row1[sortState.col] ?? '';
  let b = row2[sortState.col] ?? '';
  if (typeof a === 'object' && 'value' in a) a = a.value;
  if (typeof b === 'object' && 'value' in b) b = b.value;
  a = String(a).trim().replace(/([0-9]+)/g, (g) => g.padStart(5, '0'));
  b = String(b).trim().replace(/([0-9]+)/g, (g) => g.padStart(5, '0'));
  if (!isNaN(Number(a)) && !isNaN(Number(b))) {
    return (sortState.dir === 'asc' ? 1 : -1) * (Number(a) - Number(b));
  } else {
    return (sortState.dir === 'asc' ? 1 : -1) * String(a).localeCompare(String(b));
  }
}

function dropEmptyKeys(obj) {
  if (!obj) return obj;
  const kv = Object.entries(obj).filter(([k, v]) => (v !== '' && v !== null));
  return Object.fromEntries(kv);
}

function aggregateScores(arr) {
  arr = arr.filter(x => typeof x === 'number').sort();
  const mean = arr.reduce((x, y) => x + y, 0) / arr.length;
  const res = {
    'N': arr.length,
    'max': Math.max(...arr),
    'mean': mean|0,
    'median': arr[arr.length >> 1],
    'sd': (arr.reduce((a, x) => a + (x - mean)**2, 0) / arr.length)**0.5|0,
  };
  const k = arr.length >> 2;
  arr = arr.slice(k, arr.length - k);
  res['iqm'] = (arr.reduce((x, y) => x+y, 0) / arr.length)|0;
  return res;
}

function geometricMean(arr) {
  if (arr.length === 0) return null;
  return Math.exp(arr.map(x => Math.log(x)).reduce((x, y) => x + y, 0) / arr.length);
}
